INSERT INTO reference.abstract_article VALUES (1875346, 1, '[{"Label": null, "Abstract": "Modification of the hexahydronaphthalene ring 5-position in simvastatin 2a via oxygenation and oxa replacement afforded two series of derivatives which were evaluated in vitro for inhibition of 3-hydroxy-3-methylglutaryl-coenzyme A reductase and acutely in vivo for oral effectiveness as inhibitors of cholesterogenesis in the rat. Of the compounds selected for further biological evaluation, the 6 beta-methyl-5-oxa 10 and 5 alpha-hydroxy 16 derivatives of 3,4,4a,5-tetrahydro 2a, as well as, the 6 beta-epimer 14 of 16 proved orally active as hypocholesterolemic agents in cholestyramine-primed dogs. Subsequent acute oral metabolism studies in dogs demonstrated that compounds 14 and 16 evoke lower peak plasma drug activity and area-under-the-curve values than does compound 10 and led to the selection of 14 and 16 for toxicological evaluation.", "Category": null}]', '2018-02-27 00:02:53.593665+00', '2018-02-27 00:02:53.593665+00');
INSERT INTO reference.abstract_article VALUES (3549656, 1, '[{"Label": null, "Abstract": "The resistance of 6-[(R)-2-[3-(3,4-dihydroxybenzoyl)-3-(3-hydroxypropyl)-1-ureido]-2- phenylacetamido]penicillanic acid (1a) to metabolism by catechol-O-methyl-transferase (COMT) was increased by introduction of the chlorine atom into the catechol moiety. Penicillins (1b-1d) having one or two chlorine atoms at the positions adjacent to the hydroxyl group were found to have greater stability to COMT. This resulted in greater efficiency in vivo in experimental Pseudomonas aeruginosa and Escherichia coli infections. In vitro activities were essentially unchanged.", "Category": null}]', '2018-02-27 00:02:53.593665+00', '2018-02-27 00:02:53.593665+00');
